import Carousel from 'react-elastic-carousel'

class Slider extends React.Component {
    render() {

      return (
        <div className="styling-example">
        <Carousel itemsToShow={2}>
          <Item>1</Item>
          <Item>2</Item>
          <Item>3</Item>
          <Item>4</Item>
          <Item>5</Item>
          <Item>6</Item>
        </Carousel>
      </div>
      );
    }
  }

  export default Slider;
